import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';


ReactDOM.render(
<>
<h1 className='heading_style'>List of Top 5 Netflix Series in 2024</h1>

<Card imgSrc={Sdata[0].imgSrc} 
title='A Netflix Original Series'
sname='DARK'
link='https://www.netflix.com/in/title/80990668?source=35'/>

<Card imgSrc='https://occ-0-33-37.1.nflxso.net/dnm/api/v6/Qs00mKCpRvrkl3HZAN5KwEL1kpE/AAAABZfOyJelh8gNoR6CGlRnn6Az-2fBifHCfVwBXLPqVh-LkMPBaFk9MU8zDylJFdzBBuMpx-li7QZzq0H1VjzA9DpWZm2TDFdGTrkn9Qz7H78YMYMRn2xb-_JkdIDGVTlBd5DwDg.jpg?r=647' 
title='A Netflix Original Series'
sname='Extra Curricular'
link='https://www.netflix.com/in/title/80990668?source=35'/>

<Card imgSrc='https://wallpapercave.com/wp/wp1917154.jpg' 
title='A Netflix Original Series'
sname='Stranger Things'
link='https://www.netflix.com/in/title/80990668?source=35'/>
</>
,document.getElementById("root"));

